export default (function(a,b,c,d,e){return {data:{uxqU3s9nKb:{data:{id:2275,attributes:{imdbId:"tt0090264",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDFlNDZkMGUtYTk4ZS00MTJlLTgzNjktMTQyN2I0MDE3ZTIzXkEyXkFqcGdeQXVyMTQ4NTI5MjE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"38%"},{Source:"Metacritic",Value:"40\u002F100"}],item_lang:{data:{id:2938,attributes:{title:"A View to a Kill",plot:"James Bond has one more mission. Bond returns from his travels in the U.S.S.R. with a computer chip. This chip is capable of withstanding a nuclear electromagnetic pulse that would otherwise destroy a normal chip. The chip was created by Zorin Industries, and Bond heads off to investigate its owner, Max Zorin. Zorin may only seem like an innocent man, but is really planning to set off an earthquake in San Andreas, which will wipe out all of Silicon Valley. As well as Zorin, Bond must also tackle May Day and equally menacing companion of Zorin, while dragging Stacy Sutton along for the ride.",slug:"a-view-to-a-kill"}}},books:{data:[{id:11127,attributes:{title:"James Bond",description:"Bond battles fiendish enemies and their wicked plots in four short adventures.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=I1g_AQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["James Duncan Lawrence","Jim Lawrence","Yaroslav Horak",b],firstBook:true,published:"2007-05-01",publisher:"Titan Books",subtitle:"The Phoenix Project"}},{id:11128,attributes:{title:"From a View to a Kill",description:"Stories in the Travelman Short Stories series take the reader to places of mystery, fantasy, horror, romance, and corners of the universe yet unexplored. In turn, readers take them on the bus or subway, slip them into briefcases and lunchboxes, and send them from Jersey to Juneau. Each classic or original short story is printed on one sheet of paper and folded like a map. This makes it simple to read while commuting, convenient to carry when not, and easy to give or send to a friend. A paper envelope is provided for mailing or gift-giving, and both are packaged in a clear plastic envelope for display. The cost is not much more than a greeting card.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OAYIAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2000-09-01",publisher:"Travelman Pub",subtitle:a}},{id:11129,attributes:{title:"For Your Eyes Only",description:"The original James Bond adventure is presented in a classic, eye-catching package.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wcHZAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:d,publisher:e,subtitle:"A James Bond Novel"}},{id:11130,attributes:{title:"You Only Live Twice",description:"On the brink of becoming a security risk after the death of his wife, Secret Service agent 007 is sent to Japan and encounters an old enemy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_DwgAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:d,publisher:e,subtitle:a}},{id:11131,attributes:{title:"The Letters of Ann Fleming",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XcsdAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Ann Fleming"],firstBook:c,published:"1985-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940931800}}("","Ian Fleming",null,"2003-01-01","Penguin Group USA"))